  true,\n\t\"url\": null,\n\t\"notes\": \"The NAIP 2014 Imagery Feedback map allows
  users to make comments and observations about the quality of the 2014 National Agriculture
  Imagery Program (NAIP) acquisition. The feedback obtained from this map will be
  reviewed by APFO staff and considered both for the current year imagery and future
  updates. The feedback provided by users will help to improve the NAIP imagery program.
  To provide feedback, Click the \"Edit\" button on the toolbar, then click the open
  (green) point or polygon symbol in the editing template on the left side of the
  map. Then click on the imagery at the location of your observation/feature. To add
  only a comment click the blue map tack symbol and type in your comment. You may
  also add attachments to your comments or observations. Click the browse button in
  the attachments section of the editing pop up window and then choose the file from
  your computer. The file may be up to 10MB in size and file types include: DOC, DOCX,
  GIF, IMG, JP2, JPEG, PDF, TXT, XML, and ZIP.\",\n\t\"license_title\": \"Creative
